import React, { useState } from "react";

const imggallary = () => {
  const [allimgs, setAllimages] = useState([
    "https://media.istockphoto.com/id/517188688/photo/mountain-landscape.jpg?s=1024x1024&w=0&k=20&c=z8_rWaI8x4zApNEEG9DnWlGXyDIXe-OmsAyQ5fGPVV8=",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "https://st5.depositphotos.com/23188010/77062/i/450/depositphotos_770624600-stock-photo-green-field-morning-render-illustration.jpg",
  ]);

  const [isChecked, setisChecked] = useState(false);
  const [index , setindex] = useState(0)

  function imgclicked (link , inde){
    setisChecked(true)
    setindex(inde)
  }

  function nextandprev(kya){
    if(kya == "next" ){
        if(index <  allimgs.length - 1){
            setindex(index + 1)
        } else {
            setindex(0)
        }
    }else {
            if(index > 0){
                setindex(index - 1)
            } else{
                setindex(allimgs.length-1)
            }
    }
  }

  return (
    <>
      <div>
        <div className="m-3 flex gap-1.5 items-center justify-center flex-wrap">
          {allimgs.map((itemlink, index) => {
            return (
              <img
                onClick={(e) => imgclicked(itemlink, index)}
                className="cursor-pointer w-[300px] h-[232px] object-cover rounded-2xl"
                src={itemlink}
                alt=""
              />
            );
          })}
        </div>
        {isChecked && <div className="flex bg-green-300 fixed h-[50vh] w-[50vw] top-[50%] left-[50%] translate-x-[-50%] translate-y-[-50%]">
              <button className="cursor-pointer" onClick={()=>nextandprev("prev")}>prev</button>
              <img src={allimgs[index]} alt="" />
             <button className="cursor-pointer" onClick={()=>nextandprev("next")} >next</button>
             <button className="absolute top-0 right-0 cursor-pointer text-7xl" onClick={()=> setisChecked(false)}>X</button>
            </div>}
      </div>
    </>
  );
};

export default imggallary;
